css:
@-moz-document domain("primewire.ag"){
/*Global site things*/
body{
    background-image:none;
    background: rgb(19, 19, 19) !important;
}

.container{
	background: black !important;
}
a:hover{
    text-decoration:underline;
}
blockquote{
    background: #242424 !important;
}
input, select{
    background: #353535 !important;
}
	
/*HD link bullshit*/
.movie_version_link a:nth-of-type(2){
	position: absolute !important;
    top: -10000px !important;
}
	
/*General*/
.main_body div, .main_body div *, .mainbody{
    color: white !important;
}
.main_body div:not(.warning_message):not(.info_message), .main_body, .featured_movie_item a, .titles *, h1.titles span, h2.sub_titles, h2.sub_titles *, .footer
,#menu-bar ul li ul
{
    background: #131313 !important;
}
h1.titles{
    background:url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAVCAYAAACHUoQEAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAIGNIUk0AAHolAACAgwAA+f8AAIDpAAB1MAAA6mAAADqYAAAXb5JfxUYAAAAeSURBVHjaYhAWFv7PxMDAwEASwRA05+R/BlL0AgYANY0FSyWkaKcAAAAASUVORK5CYII=");
}
.header{
    background:url("data:image/png;base64,") !important;
    color: white !important;
    background-color: #2d2d2d !important;
}
.header div *{
    color: white !important;
}
.com_class_tv a {
    color: #8CB986 !important;
}
.com_class_mov a{
    color: #666 !important;/*devil link*/
}

.featured_movie_item img:hover{
	border:#ff0000 solid 1px;
}


#pd-vote-button8363321 > span{
	color:black !important;
}

#PDI_container8363321 .pds-answer-feedback-bar{
	background-color: #3478E3 !important;
}
	
/*Movies and TV shows*/
.movie_info_actions a{
    background-image:url("http://images.primewire.ag/images/movie_link_bar.gif") !important;
	background-repeat: repeat-x;
    color:black !important;
}
.movie_version td,.movie_version_alt,.movie_version{
    background:#131313 !important;
}
.secure_link, a.secure_link, .vpn_box, div.vpn_box, .get_a_vpn{
	display:none !important;
}
.movie_version_link a{
    color:#09f !important;
}
td .version_host{
    color:#063 !important;
}
.report_broken a{
    color: #C58785 !important;
}
h1.titles *, .loginform label{
    color:#499BD8 !important;
}
.actual_tab .warning_message{
     color:red !important;
	 background-image: url("data:image/png;base64,") !important;
}

.quality_dvd{
	background-position: 0px -64px !important;
}

.quality_hd{
	background-position: 0px -96px !important;
}

.quality_cam{
	background-position: 0px 0px !important;
}

.quality_ts{
	background-position: 0px -32px !important;
}

.quality_unknown{
	background-position: 0 -128px !important;
}


.quality_dvd, .quality_hd, .quality_cam, .quality_ts, .quality_unknown{
	background-image: url("data:image/png;base64,");
}

.help_link a{
	color:orange !important;
}

.info_message{
	background-image:url('data:image/png;base64,') !important;
	background-repeat: no-repeat;
}

  
/*Profile things*/
.profile_button span{
    background-color: #353535;
    border-radius: 5px;
}
a .profile_button, a.profile_button{
    background: none !important;
}

/*Top users*/
td.top_users{
    background: #131313 !important;
}
td.top_users_alt{
    background: #242424 !important;
}
  
/*Forums*/
.top_users{
	background: #242424 !important;
}
}
